import React, { useState } from 'react';

import { doGet } from '../../helpers/ApiHelpers';

const Home = () => {
    const [people, setPeople] = useState([]);

    doGet('people/').then(response => setPeople(response.results));

    return <h1>Home</h1>
};

export default Home;
